import React from "react";

import "./style.css";


function Homepage() {
  return (
    <div  style={{ backgroundColor: "black"}}>
      <img
                      src="img/bg.jpg"
                      className="card-img-top"
                      alt="IMG"
                      width="300"
                      height="600"
                    ></img>
     
    </div>
  );
}

export default Homepage;
